import { configureStore } from "@reduxjs/toolkit";
import cartReducer from "./cartRedux"
import wishlistReducer from './wishlistRedux'

export default configureStore({
    reducer:{
        cart : cartReducer,
        wishlist : wishlistReducer,
    }
})
